import {Constants} from "../constants/authConstance"

export const authLogInAction = (data) => {
    return {
        type: Constants.LOG_IN,
        payload: data
    }
}

export const authLogAction = (data) => {
    return {
        type: Constants.LOG_OUT,
        payload: data
    }
}
